const CardCarLocation= loc.map((user,i)=>{
        return   <Marker
                            key={i}
                            google={this.props.google}
                            name={'Dolores park'}
                            position={{ lat: loc[i].lat, lng: loc[i].lng }}
                            
                             icon={{

                                  url: car2,
                                  scaledSize :  window.google.maps.Size(25,25 ),

    }}

        
                            
                         onClick={() => this.handleToggleOpen(i)}

        
                            
                        >
                       {isOpen && i===this.state.indexOpen &&( 
                        <InfoWindow
                            
                        >
                         
                            <div>
                                <span style={{ padding: 0, margin: 0 }}>{this.state.address}</span>
                            </div>
                        </InfoWindow>)}
                    </Marker>
    })
	

return(

<div/>
	)


}

